import React from "react"; //import React library
import { SenatorRow } from "./SenatorRow.js";
import { TableHeader } from "./TableHeader.js";
const EXAMPLE_SENATORS = [
  {
    id: "C000127",
    name: "Maria Cantwell",
    state: "WA",
    party: "Democrat",
    phone: "202-224-3441",
    twitter: "SenatorCantwell",
  },
  {
    id: "M001111",
    name: "Patty Murray",
    state: "WA",
    party: "Democrat",
    phone: "202-224-2621",
    twitter: "PattyMurray",
  },
];

/* Your code goes here */
export function SenatorTable(props) {
  let senators = props.senators;
  let columnNames = ["Name", "State/Party", "Phone", "Twitter"];
  let tableHeader = <TableHeader columnNames={columnNames} />;
  let tableRows = senators.map((senator) => {
    return <SenatorRow senator={senator} key={senator.id} />;
  });
  return <table className="table table-bordered"></table>;
}
